import "./App.css";
import { Route, Routes, BrowserRouter } from 'react-router-dom'
import ManageCourses from './screens/ManageCourses'

function App() {
  return (
    <div className='container-fluid'>
      <BrowserRouter>
      <Routes>
       

        
          <Route path='/' element={<ManageCourses />} />
          <Route path='/' element={<ManageInstructors />} />

          
       
      </Routes>
      </BrowserRouter>
      
    </div>

      
      


  
  )}

export default App;
